import React from 'react'
import Home from '../home/Home';
import { DetailContainer } from './style';


function Details({ setQuery, query, getData, mealTypes, setMeal, meal } ) {
    return (
        <DetailContainer
        setQuery={setQuery}
        query={query}
        getData={getData}
        mealTypes={mealTypes}
        setMeal={setMeal}
        meal={meal}>

        </DetailContainer>
    )
}

export default Details
